import React,{Component} from 'react'
import {ListGroup, ListGroupItem, PageHeader} from 'react-bootstrap'
import './List.css'

// --------------------Stateless component
// --------------------------------------------
class List extends Component {

    state={
        sortBy:""
    }


render(){



return(
    <div>
{/*----------------------------Header------------------------------------*/}
<PageHeader className="tracking-in-expand-fwd-top" id="header">
List of players
</PageHeader>


<FormGroup controlId="formControlsSelect">
      <ControlLabel>Select</ControlLabel>
      <FormControl autoFocus componentClass="select" placeholder="select">
        <option value="select">Name</option>
        <option value="other">Rating</option>
      </FormControl>
</FormGroup>

{/*----------------------------Players List------------------------------------*/}
<ListGroup id="playersList">
{props
    .mainstate
    .players
    .map((player, index) => <ListGroupItem id="playerItem">
        {index + 1}.&nbsp;Name:{player.value}&nbsp;Rating:{player.rating}
    </ListGroupItem>)}
</ListGroup>

</div>

)
}
}
    


export default List;
